import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>this is header.</p>
      </header>
      <body className="App-body">
<p>this is body</p>
      </body>
    </div>
  );
}

export default App;
